        <>
      <Navbar/>

      <MetaData title="SSTC MARKETPLACE" />

    <div className="banner">

     <h1>Welcome to Shri Shankaracharya Vidyalaya Technical Campus</h1>
     <a href="#container">

            </a>

          </div>
    <Footer/>

        </>
    )
}

export default Header;
